{"reasoning":"Ground truth bug: The boat physically moves/propels forward when the player walks on it – an unintended physics interaction (player movement causes boat displacement).

Generated report: Describes visual/rendering issue where the water plane intersects the boat, flooding its interior; the boat "remains static" and does not move. No mention of player-induced motion. Root cause and symptoms differ (rendering clipping vs. physics impulse).

Therefore, they do not describe the same underlying bug.","match":false}

{"reasoning":"Ground truth describes a visibility issue: the NPC being arrested and the police car are completely invisible, while the officer is visible and behaves normally. The core symptom is missing/ invisible objects.

The generated report describes an animation-state problem: after an interaction the player model stays in a seated pose, hovers and slides, with physics disabled. All objects (player, environment) are still visible; the issue is the pose / locomotion, not invisibility.

Because the symptoms, affected systems (rendering/visibility vs animation state machine), and observed results are different, the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"The ground-truth bug is a visual glitch: an NPC appears without a head, stands in front of a vehicle, and then completely vanishes. The key symptoms are the missing head and the sudden disappearance of the whole character.

The generated report is about hit-detection/physics: infantry can overlap with an armored car and not take road-kill damage. There is no mention of a missing head or the character disappearing; instead the soldier remains present and functional, only invulnerable to the vehicle.

Because the core behaviors, symptoms, and affected systems differ (rendering/visibility vs. collision damage), the two reports describe different bugs.","match":false}

{"reasoning":"Ground truth bug is about a stationary scene in which a yellow/orange tanker truck visually shakes or oscillates despite the rest of the world remaining still – a physics/animation jitter on the truck itself.

Generated report describes a completely different problem: the third-person camera penetrates the geometry of a black box-truck and nearby pillar, causing the view to be occluded and objects to flicker. This concerns camera collision handling, not the truck’s own movement or shaking. No mention of the truck oscillating while stationary, nor of a yellow/orange tanker truck.

Because the symptoms, affected systems (camera vs. vehicle physics), conditions, and described visual results differ, the two reports do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth: A solid building exists, but the player/camera can push into the building’s interior space and, because the camera is inside the wall, the void behind the wall becomes visible (camera-clipping issue). Geometry and collision are present; the problem is the camera/character intersecting them.

Generated report: Objects in the dock-yard sometimes fail to stream in, turning black or fully invisible and losing collision. Geometry and collision disappear, letting the player walk through or fall under the map. The fault is missing/ unloaded assets, not a camera penetrating intact geometry.

Although both let the player see the void or go out-of-bounds, the root symptom is different: one is a camera/character clipping through an existing wall; the other is walls not loading at all (no collision). Therefore they do not describe the same underlying bug.","match":false}

{
  "reasoning": "Both texts involve a character that ends up on a rooftop, but the manner and accompanying symptoms differ markedly. \n• Ground truth: (1) Trigger is being \"near the window\"; (2) the character is suddenly *launched* into the air; (3) animation glitch described is a single leg bent upward while the character keeps walking. No mention of extra objects or attachments.\n• Generated report: (1) Trigger is mission completion; (2) the NPC simply *spawns* on a rooftop—no launch event; (3) the visible glitch is a long, rigid leash/rope stretching through the building, not an odd leg pose.\nThese describe different visual artefacts and different triggering situations, implying different underlying causes. The only commonality is an out-of-place character on a roof, which is too generic to assume they are the same bug. Therefore they should be considered non-matching.",
  "match": false
}

{"reasoning":"Ground-truth describes an animation bug in which a character actually plays a swimming animation while in mid-air ("swimming in the air").

The generated report talks about a companion who, after leaving a vehicle, remains frozen in the horizontal "passenger" pose (arms forward like Superman) and glides above the ground. No swimming strokes or swim-cycle animation is mentioned; the animation that is stuck is specifically the vehicle-passenger pose, not a swim animation.

Although both issues involve a character floating horizontally above the ground, the specific animation that is erroneously playing – swim cycle vs. vehicle-passenger pose – is different, pointing to different animation-state bugs. Therefore they do not describe the same underlying bug.","match":false}

{"reasoning":"Ground-truth bug is a post-death physics glitch: once the enemy is killed it continually bounces / oscillates up-and-down around a wooden pillar. The core symptoms are (1) occurs only after death, (2) involves continuous vertical movement (bouncing).

Generated report describes a live enemy (during a leap attack) getting wedged in the beams of a small wooden stall, then remaining frozen/levitating several metres above ground. The NPC stops moving (no bouncing) and the problem can persist after it is later killed, but the primary trigger and observable behaviour are different: the enemy is immobilised and static, not endlessly bobbing. Environment is a stall with horizontal beams rather than simply a pillar.

Because the trigger condition, motion behaviour (frozen vs bouncing), and effect differ, the two descriptions refer to different physics bugs.","match":false}

{"reasoning":"Ground-truth focuses on a very specific animation defect: while the skater is airborne above a rail the character’s legs twist/wrap around the body and keep rotating unrealistically, but the skater never clips into the rail and there is no mention of a bail, rag-doll, duplicate mesh or any collision overlap.

The generated report, on the other hand, centers on the board and skater penetrating the rail geometry. The overlap triggers the rag-doll system, causes model ghosting, stretching, and finally leaves the character embedded in the ground. The key symptom is collision/clipping through the rail, not merely strange leg rotation while hovering above it.

Although both occur near a rail and both describe odd limb behaviour, the causes and visible results are different: “hovering rotation glitch” versus “collision clipping & rag-doll spasm”. Therefore they should be considered different bugs.","match":false}

{"reasoning":"Ground truth describes a purely animation / clipping problem: a wrestler who is already on the ground has his hand intersecting his own body and the whole body is shaking rapidly. There is no reference to match-end state, UI elements, or the wrestler being stuck in a particular animation loop.

Generated report focuses on two issues that occur after a submission ends: (1) the submission HUD gauge stays on-screen together with the winner banner, and (2) the defeated wrestler keeps looping a stunned rollover animation, which makes him "twitch". The core problem is the match-end state not clearing UI and not switching animation states.

Although both reports mention a shaking / twitching character on the mat, the generated report’s problem is specifically about an incorrect state transition at match end and persistent UI; it does not mention the hand clipping into the torso that defines the ground-truth bug. Conversely, the ground truth does not mention any UI persistence or match-end state issues. These describe different underlying defects.","match":false}

{"reasoning":"Ground truth: A robot/droid momentarily gets hung up on the very edge of a platform, standing sideways in mid-air, but after a short time gravity wins and it slowly slides/falls off. Key elements: (1) on edge of platform, not embedded in geometry; (2) only temporary – it eventually drops; (3) no mention of soft-lock or combat blockage.

Generated report: The security droid actually clips halfway into the wall/floor seam of a catwalk corner and stays there indefinitely. Because it is inside the geometry its health bar remains, combat cannot progress, and the player can bypass the fight. Key elements: (1) droid is partially inside wall; (2) remains stuck permanently; (3) causes encounter soft-lock.

While both involve a droid becoming stuck near a platform edge and oriented sideways/horizontally, the ground truth describes a brief physics glitch that resolves itself when the droid falls, whereas the generated report describes a persistent clipping/embedding bug that does not resolve and affects gameplay progression. These are behaviorally and impact-wise different issues, indicating they are not the same underlying bug.","match":false}

{"reasoning":"Ground truth bug: a horse-drawn carriage pops in suddenly in front of the player, causing an unavoidable collision; result is the normal knock-off/throw of the rider.  The key defect is the carriage’s sudden appearance (pop-in/spawn) leading to the collision.

Generated report: collision with an existing NPC wagon makes the player dismount, but the abnormal part is that the player’s horse instantly despawns afterward.  The defect is the disappearance of the horse entity, not the sudden spawning of the wagon.

Although both situations involve a rider colliding with a wagon/carriage and being dismounted, the underlying problems differ: ground truth = carriage spawning bug; generated report = horse despawn after collision.  Therefore they do not describe the same bug.","match":false}

{"reasoning":"Ground truth bug concerns NPCs repeatedly jumping/bouncing into the air, including one jumping exceptionally high. The key symptoms are unexpected vertical movement (bouncing) of multiple NPCs in open space.

Generated report describes a single guard NPC that teleports onto the roll-bar of the player’s jeep and stands hovering in place with feet not touching any surface. No bouncing or repeated jumping occurs; issue is a wrong spawn/position on top of a vehicle, leading to hovering/clipping, not continuous vertical motion.

Because the behaviors, circumstances, and symptoms are different, the generated bug report does not correspond to the ground-truth description.","match":false}

{"reasoning":"Ground truth: a large sea creature briefly slides and then vanishes (despawns/disappears). Key symptoms: momentary sliding movement followed by disappearance of the whole creature.

Generated report: when a Sea-Dragon Leviathan is hit with a Stasis Rifle, its mesh deforms, stretching into noodle-like strands; it remains present (though distorted) and the problem is a model-scaling/animation error, not disappearance.

The core behaviors, triggers, and results are different: disappearance vs. mesh stretching; random slide vs. stasis-induced deformation. Therefore they do not describe the same underlying bug.","match":false}
